import React from 'react';
// import {NavLink} from "react-router-dom";
// import $ from 'jquery';
import Slider from "react-slick";

// Import css files
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

class Myslider extends React.Component {

  // constructor(props) {
  //   super(props)
  // }

  render() {
    var settings = {
      autoplay: true,
      autoplaySpeed: 1000,
      speed: 500,
      vertical: true
    };
    return (
      <Slider {...settings}>
        <div>
          <h3><a href="#">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</a></h3>
        </div>
        <div>
          <h3><a href="#">Welcome to Colorlib Family.</a></h3>
        </div>
        <div>
          <h3><a href="#">Nam eu metus sitsit amet, consec!</a></h3>
        </div>
        <div>
          <h3><a href="#">4 - Lorem ipsum dolor sit amet, consectetur adipiscing elit.</a></h3>
        </div>
        <div>
          <h3><a href="#">5 - Welcome to Colorlib Family.</a></h3>
        </div>
        <div>
          <h3><a href="#">6 - Nam eu metus sitsit amet, consec!</a></h3>
        </div>
      </Slider>
    );
  }
}

export default Myslider;
